def is_balanced(s):
    stack = []
    for char in s:
        if char == '(':
            stack.append(char)
        elif char == ')':
            if not stack:
                return "Parentheses not balanced."
            stack.pop()
    return "Parentheses are balanced." if not stack else "Parentheses not balanced."

