        return [(position[0] + dx, position[1] + dy) for dx in [-1, 0, 1] for dy in [-1, 0, 1] if (dx, dy) != (0, 0)]

class Queen(Piece):
    def moves(self, position):
        return [(position[0] + dx, position[1] + dy) for dx in range(-7, 8) for dy in range(-7, 8) if abs(dx) == abs(dy) or dx == 0 or dy == 0]

class Rook(Piece):
    def moves(self, position):
        return [(position[0] + dx, position[1]) for dx in range(-7, 8) if dx != 0] + [(position[0], position[1] + dy) for dy in range(-7, 8) if dy != 0]

class Bishop(Piece):
    def moves(self, position):
        return [(position[0] + dx, position[1] + dx) for dx in range(-7, 8) if dx != 0] + [(position[0] + dx, position[1] - dx) for dx in range(-7, 8) if dx != 0]

class Knight(Piece):
    def moves(self, position):
        return [(position[0] + dx, position[1] + dy) for dx, dy in [(2, 1), (2, -1), (-2, 1), (-2, -1), (1, 2), (1, -2), (-1, 2), (-1, -2)]]

